import './../Style/History.css';
import './../Style/EditProfile.css';
import { Link, useParams, useNavigate } from "react-router-dom";
import { useState, useEffect } from "react";
import {variables} from "../Variables";
import Swal from 'sweetalert2'
import withReactContent from 'sweetalert2-react-content'

function AppPayment(){
    const [price, setPrice] = useState(0);
    const [order, setOrder] = useState();
    const { id } = useParams();

    useEffect(() => {
        fetch(variables.API_URL+"get_order/"+id, {
            method: "GET",
            headers: {
                'Accept': 'application/json, text/plain',
                'Content-Type': 'application/json;charset=UTF-8'
            },
            })
            .then(response => response.json())
            .then(result => {
                console.log(result)
                if(result.length > 0){
                    setOrder(result)
                }
            }
        )
    })

    return(
    <div className="history">
        <h1>Payment</h1>
        <div className="input-frame">
            <form>
                {/* <input className="input" id="register-FirstName" type="text" name="firstName"
                placeholder="First Name" value={} onChange={(e) => setFirstname(e.target.value)} required/> */}
                <span className="symbol">
                    <i className="fa-solid fa-user"></i>
                </span>
            </form>
        </div>
    </div>
    );

}

export default AppPayment;
